import React from "react";
import Paper from "@material-ui/core/Paper";
import TextField from "@material-ui/core/TextField"
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography'
import { shadows } from '@material-ui/system';
const LoginBox = () => {
  return (
    <Paper style={{ padding: 100 }} boxShad elevation={0} variant="outlined">
        <Typography variant='h4'>Goal Book</Typography>
      <form style={{ marginTop: 10 }}noValidate autoComplete="off">
        <TextField id="standard-basic" label="Email" />
      </form>
      <form style={{ marginTop: 10, marginBottom: 10 }} noValidate autoComplete="off">
        <TextField id="standard-basic" label="Password" />
      </form>
      <Button style={{ paddingLeft: 5, paddingRight: 5 }}>Login</Button>
      <Button style={{ paddingLeft: 5, paddingRight: 5, marginleft: 100 }}>Sign up</Button>
    </Paper>
  );
};

export default LoginBox;
